import React from 'react';
import User from './User';
import './css/users.css'

const deleteAll = () => {
    const elem = document.getElementById('usersContainer')
    elem.parentNode.removeChild(elem);
}

const Users = ({users}) => {
    return(
        <div id='usersContainer'>
            {
                users.map( (element, i) => {
                    return <User 
                    id = {users[i].id}
                        name={users[i].name} 
                        username={users[i].username}
                        email={users[i].email}
                        /> 
                    })
                }
                <button onClick={deleteAll} style={{display: 'block', width: '100%'}}>Delete all</button>
            </div>
    );
}

export default Users;
